import React from "react";
import { styled } from "styled-components";

const Wrapper = styled.section`
  background-color: pink;
`;
const Skill = styled.h2`
  font-size: 30px;
`;

const Plofile = styled.h2``;

const About = () => {
  return (
    <Wrapper>
      <Skill>スキル</Skill>
      <Plofile>経歴</Plofile>
    </Wrapper>
  );
};

export default About;
